Hot Models...String bikinis...Luscious backdrops...Have you ever wanted to know what goes on behind the scenes of a photo shoot for a sexy, new swimwear calendar? Take a peek at Babes Illustrated 7: The Swimsuit Edition, and you'll find a whole new meaning for the phrase, &quot;lights, camera, action!&quot; What begins as an all-day photo shoot quickly turns into an all-day, all-nude body romp when eight gorgeous models, a lusty make-up artist, and a sex-crazed female photographer get together on the Babes set. Add oil and water, and the recipe for sex is complete! Grab a ringside seat for this all-girl Sextravaganza, and your insider's view to the world of high fashion can be summed up in three words: Hot, Wet, and Wild!
